script: |
  super -f text -I q11091.spq | sort > q11091.out

inputs:
  - name: q11091.spq
    data: |
      SELECT DISTINCT - - col0 AS col1, - 12 / + col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT col2 IS NULL AND NOT col1 * - CAST ( - + col0 AS INTEGER ) * - col1 IS NOT NULL;
  - name: tab0

outputs:
  - name: q11091.out
    data: |
